import React from 'react';

function AnswerButton(props) {
  return (
    <input type="button"
      onClick={props.handleSelection}
      className={`game-button question-button`}
      value={props.btnValue.toLowerCase()}
      disabled={props.disabled}
    >
      {props.btnValue}
    </input>
  );
}

export default AnswerButton;
